import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { dashboardManager } from '../redux/slices/managerSlices'
import { Table, Row, Col, Tooltip, User, Text ,Button, Grid, Spacer} from "@nextui-org/react";
import { Link, Navigate } from "react-router-dom";
import Moment from 'react-moment';
// import { EditIcon } from "./Icon/EditIcon";
// import { DeleteIcon } from "./Icon/DeleteIcon";
const Home = () => {
  const dispatch=useDispatch();
  useEffect(()=>{
      dispatch(dashboardManager());
      },[dispatch]);

const emplyeedata=useSelector((state)=>state?.users?.dashboardData);
  return (
    <div>
 <Table
      aria-label="Example table with static content"
      css={{
        height: "auto",
        minWidth: "100%",
      }}
    >
      <Table.Header>
        <Table.Column>NAME</Table.Column>
        <Table.Column>Mobile</Table.Column>
        <Table.Column>Joined</Table.Column>
        <Table.Column>EmployeeId</Table.Column>
        <Table.Column>Action</Table.Column>
      </Table.Header>
      <Table.Body>
        {emplyeedata?.employees?.map(employee=>{return (
             <Table.Row key={employee.id}>
             <Table.Cell>{employee?.firstName + ' ' +employee?.firstName}</Table.Cell>
             <Table.Cell>{employee?.mobile}</Table.Cell>
             <Table.Cell><Moment format="YYYY/MM/DD">{employee?.createdAt}</Moment></Table.Cell>
             <Table.Cell>{employee?.empId}</Table.Cell>
             <Table.Cell><Grid.Container><Grid><Button color='warning'>update</Button></Grid><Spacer/><Grid><Button color='error'>delete</Button></Grid></Grid.Container> </Table.Cell>
           </Table.Row>)
        })}
      </Table.Body>
    </Table>
    </div>
  )
}

export default Home
